    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <ul>
        <li>Anish Karki</li>
        <li>Ashish Rajthala</li>
        <li>Badal Karki</li>
        <li>Nischal Shrestha</ li>
        </ul>
        <p> Wassssssup Dawgs!!!</p>
      </header>
    </div>
  );
}

export default App;
